import React from 'react'

import AddShoppingCartIcon from '@mui/icons-material/AddShoppingCart';

import * as Style from './styled';

const Header = () => {
    return (
        <Style.Header>
					<div className="left"></div>
					<div className="center"></div>
					<div className="right">
						<AddShoppingCartIcon/>
					</div>
        </Style.Header>
    )
}

export default Header;
